import React from 'react';
import { Container, Typography, Box, Avatar, Grid, Paper, Card, CardContent, CardActions, Button } from '@mui/material';
import { motion } from 'framer-motion';

// Testimonial data
const testimonials = [
  { name: 'John Doe', position: 'Student', feedback: 'This platform has changed the way I learn. The courses are incredibly well-structured and engaging!' },
  { name: 'Jane Smith', position: 'Professional', feedback: 'I’ve gained valuable skills that have helped me advance in my career. Highly recommend to anyone looking to upskill.' },
  { name: 'Michael Brown', position: 'Entrepreneur', feedback: 'The practical insights and interactive content are fantastic. It’s like having a personal tutor online.' },
  { name: 'Emily Johnson', position: 'Designer', feedback: 'The variety of courses available is impressive. I found exactly what I needed to enhance my design skills.' },
  { name: 'Sarah Lee', position: 'Developer', feedback: 'Excellent learning experience with up-to-date content. It’s helped me stay on top of the latest trends in technology.' }
];

const teamMembers = [
  { name: 'Alice Johnson', role: 'CEO', image: 'alice.jpg' },
  { name: 'Bob Smith', role: 'CTO', image: 'bob.jpg' },
  { name: 'Carol Davis', role: 'CMO', image: 'carol.jpg' },
];

const AboutUs = () => {
  return (
    <Container sx={{ marginTop: 4 }}>
      <Box sx={{ textAlign: 'center', marginBottom: 4 }}>
        <Typography variant="h2" gutterBottom>About Us</Typography>
        <Typography variant="body1" paragraph>
          We are a dedicated team of educators and technologists committed to providing high-quality online education.
        </Typography>
        <Typography variant="body1" paragraph>
          Our mission is to make learning accessible and enjoyable for everyone, everywhere.
        </Typography>
      </Box>
      <Typography variant="h4" gutterBottom sx={{ textAlign: 'center' }}>Our Team</Typography>
      <Grid container spacing={4}>
        {teamMembers.map((member, index) => (
          <Grid item key={index} xs={12} sm={4}>
            <motion.div whileHover={{ scale: 1.05 }}>
              <Paper elevation={3} sx={{ padding: 3, textAlign: 'center' }}>
                <Avatar
                  src={member.image}
                  alt={member.name}
                  sx={{ width: 100, height: 100, margin: '0 auto', marginBottom: 2 }}
                />
                <Typography variant="h6" gutterBottom>{member.name}</Typography>
                <Typography variant="body1" color="text.secondary">{member.role}</Typography>
              </Paper>
            </motion.div>
          </Grid>
        ))}
      </Grid>
      <Typography variant="h4" gutterBottom sx={{ textAlign: 'center', marginTop: 8 }}>What Our Users Say</Typography>
      <Grid container spacing={4}>
        {testimonials.map((testimonial, index) => (
          <Grid item key={index} xs={12} sm={6} md={4}>
            <Card sx={{ boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)', borderRadius: 2, padding: 2 }}>
              <CardContent>
                <Typography variant="body1" paragraph>{testimonial.feedback}</Typography>
                <Typography variant="subtitle1" fontWeight="bold">{testimonial.name}</Typography>
                <Typography variant="body2" color="text.secondary">{testimonial.position}</Typography>
              </CardContent>
              <CardActions sx={{ justifyContent: 'center' }}>
                <Button size="small" color="primary">Read More</Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default AboutUs;
